Le Ballon Rouge and Crin Blanc are two cineastic masterpieces from the 1950 ties
by Albert Lamorisse

Crin Blanc is about a growing love and fascination between a boy and a wild horse.
A charming tale told with a magnificent photo.

Le Ballon Rouge is about a boy and a ballon with magical properties. It is also about
cruelty among children and the magic of fantasy.

